import React from 'react'

class StatDist extends React.Component {

    state = {
        statVals: []
    }
    render(){
        return(
            <div>
                {this.props.strength === 0 ? <button>Strength</button> : null }
                {this.props.dexterity === 0 ? <button>Dexterity</button> : null }
                {this.props.constitution === 0 ? <button>Constitution</button> : null }
                {this.props.intelligence === 0 ? <button>Intelligence</button> : null }
                {this.props.wisdom === 0 ? <button>Wisdom</button> : null }
                {this.props.charisma === 0 ? <button>Charisma</button> : null }
            </div>
        )
    }
}

export default StatDist
